script: |
  super -f text -I q6604.spq | sort > q6604.out

inputs:
  - name: q6604.spq
    data: |
      SELECT DISTINCT - COUNT ( * ) FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - 17 IN ( - col2, - col1, - col2, + + col2 * + col2, - ( + ( col0 ) ) + + - col1 );
  - name: tab1

outputs:
  - name: q6604.out
    data: |
      -3
